VALUES
	(17,'博客更新记录','本博客的更新记录，开源情况等消息都会在改文章中体现，敬请关注。','<h4 id=\"h4-v1-0\"><a name=\"v1.0\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>v1.0</h4><hr>\r\n<p>实现功能:</p>\r\n<ul>\r\n<li>1.文章编辑修改</li><li>2.文章展示，列表，查询</li><li>3.友情链接添加<h4 id=\"h4-github-\"><a name=\"github入口\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span><a href=\"https://github.com/zzlhr/lblog\">github入口</a></h4></li></ul>\r\n<h4 id=\"h4-v-1-0-1\"><a name=\"v 1.0.1\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>v 1.0.1</h4><h6 id=\"h6-2018-02-10-10-47-50\"><a name=\"2018-02-10 10:47:50\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>2018-02-10 10&#58;47&#58;50</h6><hr>\r\n<p>修复bug:</p>\r\n<ul>\r\n<li>1.后台登录过滤器未成功注册问题</li></ul>\r\n<p>增加:</p>\r\n<ul>\r\n<li>1.对文章添加独立title,keywords和description</li></ul>\r\n<h4 id=\"h4-v-1-0-2\"><a name=\"v 1.0.2\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>v 1.0.2</h4><h6 id=\"h6-2018-02-16-03-21-32\"><a name=\"2018-02-16 03:21:32\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>2018-02-16 03&#58;21&#58;32</h6><hr>\r\n<p>1.修复若干bug<br>2.添加评论<br>3.添加github登录</p>\r\n<h4 id=\"h4-v-1-0-3\"><a name=\"v 1.0.3\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>v 1.0.3</h4><h6 id=\"h6-2018-02-24-15-24-00\"><a name=\"2018-02-24 15:24:00\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>2018-02-24 15&#58;24&#58;00</h6><hr>\r\n<p>1.修复若果bug<br>2.修改所有base64依赖包<br>3.修改密码、token加密方式<br>4.修复分页居中<br>5.添加标签查询<br>6.补充文档</p>\r\n','#### v1.0\r\n---\r\n实现功能:\r\n- 1.文章编辑修改\r\n- 2.文章展示，列表，查询\r\n- 3.友情链接添加\r\n#### [github入口](https://github.com/zzlhr/lblog)\r\n\r\n#### v 1.0.1\r\n###### 2018-02-10 10:47:50\r\n---\r\n修复bug:\r\n- 1.后台登录过滤器未成功注册问题\r\n\r\n增加:\r\n- 1.对文章添加独立title,keywords和description\r\n\r\n#### v 1.0.2\r\n###### 2018-02-16 03:21:32\r\n---\r\n1.修复若干bug\r\n2.添加评论\r\n3.添加github登录\r\n\r\n\r\n\r\n#### v 1.0.3\r\n###### 2018-02-24 15:24:00\r\n---\r\n1.修复若果bug\r\n2.修改所有base64依赖包\r\n3.修改密码、token加密方式\r\n4.修复分页居中\r\n5.添加标签查询\r\n6.补充文档\r\n\r\n',3,0,'2018-02-09 13:15:57','2018-02-24 15:26:34'),
	(19,'ssh连接带端口','ssh连接liunx带端口号的方法','<h5 id=\"h5--ssh-\"><a name=\"现在很多服务器供应商都会把默认的ssh端口开在比较靠后的位置，所以很多时候我们不能直接通过\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>现在很多服务器供应商都会把默认的ssh端口开在比较靠后的位置，所以很多时候我们不能直接通过</h5><p><code>ssh <a href=\"mailto:root@xxx.xxx.xxx\">root@xxx.xxx.xxx</a>.xxx</code><br>的方式进行连接<br>带端口的操作也是非常简单的，只需要加一个参数 <code>-p</code> 即可<br><code>ssh -p [port] [user]@[ip]</code><br>例如：<br><code>ssh -p 2222 <a href=\"mailto:root@123.123.123\">root@123.123.123</a>.123</code></p>\r\n','##### 现在很多服务器供应商都会把默认的ssh端口开在比较靠后的位置，所以很多时候我们不能直接通过\r\n``` ssh root@xxx.xxx.xxx.xxx``` \r\n的方式进行连接\r\n带端口的操作也是非常简单的，只需要加一个参数 ```-p``` 即可 \r\n``` ssh -p [port] [user]@[ip] ```\r\n例如：\r\n``` ssh -p 2222 root@123.123.123.123  ```\r\n\r\n\r\n',3,0,'2018-02-16 01:33:27','2018-02-16 01:33:27'),
	(20,'spring data jpa--No property create found for type xxx异常','No property create found for type xxx异常','<h6 id=\"h6--code-pagerequest-code-\"><a name=\"出现如题的情况应该最常见的情况就是使用<code>PageRequest</code> 对象但是排序的字段不存在或者排序字段是使用数据库的命名来的\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>出现如题的情况应该最常见的情况就是使用<code>PageRequest</code> 对象但是排序的字段不存在或者排序字段是使用数据库的命名来的</h6><p>这里说一下 spring data的Sort对象排序必须使用Java对象的命名，也就是说</p>\r\n<p>数据库字段叫create_time<br>Java中pojo对象该字段对应为createTime<br>那么排序应该为<br><code>new Sort(Sort.Direction.DESC, &quot;createTime&quot;);</code></p>\r\n','###### 出现如题的情况应该最常见的情况就是使用```PageRequest``` 对象但是排序的字段不存在或者排序字段是使用数据库的命名来的\r\n\r\n这里说一下 spring data的Sort对象排序必须使用Java对象的命名，也就是说\r\n\r\n数据库字段叫create_time\r\nJava中pojo对象该字段对应为createTime\r\n那么排序应该为\r\n``` new Sort(Sort.Direction.DESC, \"createTime\"); ```',3,0,'2018-02-16 03:28:15','2018-02-16 03:28:15'),
	(23,'nginx代理后解决session/cookies丢失问题解决方案','通过配置nginx解决代理后的session/cookies丢失','<p>只需要在该站点的配置文件中添加下列配置即可<br><code>proxy_set_header  Cookie $http_cookie;</code></p>\r\n','只需要在该站点的配置文件中添加下列配置即可\r\n``` proxy_set_header  Cookie $http_cookie;```',3,0,'2018-02-22 10:36:10','2018-02-22 10:36:10'),
	(24,'博客部署-linux','本博客部署过程及注意事项。','<h1 id=\"h1-jar-\"><a name=\"jar包形式\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>jar包形式</h1><ul>\r\n<li>自行编译部署</li><li>直接使用</li></ul>\r\n<h1 id=\"h1-u81EAu884Cu7F16u8BD1\"><a name=\"自行编译\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>自行编译</h1><pre><code class=\"lang-shell\"># 创建目录\r\nmkdir /var/blog &amp;&amp; cd /var/blog\r\n# 拉取文件\r\nsudo wget https://github.com/zzlhr/lblog/archive/master.zip\r\n# 解压\r\nsudo unzip master.zip\r\n# 进入解压目录\r\ncd lblog-master\r\n</code></pre>\r\n<p>修改配置文件</p>\r\n<pre><code class=\"lang-shell\">sudo vim src/main/resources/application.yml\r\n</code></pre>\r\n<h5 id=\"h5--\"><a name=\"注意此处有几个必须要修改的地方。\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>注意此处有几个必须要修改的地方。</h5><ul>\r\n<li>github的密匙，需要自己创建一个。</li><li>数据库账号密码url</li><li>blog里的内容，你的上传地址你的域名</li><li>日志存放地址</li></ul>\r\n<p>确认上述内容无误后<br>执行</p>\r\n<pre><code class=\"lang-shell\">sudo mvn package\r\n</code></pre>\r\n<p>打好的包在target/ 下</p>\r\n<p>设置为linux服务的方法参照<a href=\"https://www.cnblogs.com/zhengshiqiang47/p/8119944.html\">设置spring-boot为linux</a></p>\r\n','# jar包形式\r\n\r\n- 自行编译部署\r\n- 直接使用\r\n\r\n# 自行编译\r\n\r\n```shell \r\n# 创建目录\r\nmkdir /var/blog && cd /var/blog\r\n# 拉取文件\r\nsudo wget https://github.com/zzlhr/lblog/archive/master.zip\r\n# 解压\r\nsudo unzip master.zip\r\n# 进入解压目录\r\ncd lblog-master\r\n```\r\n\r\n修改配置文件\r\n\r\n```shell\r\nsudo vim src/main/resources/application.yml\r\n```\r\n##### 注意此处有几个必须要修改的地方。\r\n- github的密匙，需要自己创建一个。\r\n- 数据库账号密码url\r\n- blog里的内容，你的上传地址你的域名\r\n- 日志存放地址\r\n\r\n\r\n确认上述内容无误后\r\n执行\r\n```shell \r\nsudo mvn package\r\n```\r\n\r\n打好的包在target/ 下\r\n\r\n设置为linux服务的方法参照[设置spring-boot为linux](https://www.cnblogs.com/zhengshiqiang47/p/8119944.html)\r\n\r\n\r\n\r\n\r\n\r\n\r\n',3,0,'2018-02-24 14:34:52','2018-02-24 14:34:52'),
	(25,'【微信小程序】上拉刷新的使用和遇到的坑','最近在开发微信小程序，后续如果时间允许的情况下我会时不时的发布一些关于微信小程序的文章','<p>最近在开发微信小程序，发现坑不是很多了，<br>除了ide有点忽悠之外，<br>优点也是很多，<strong>无需安装</strong>，<strong>可以调用微信接口</strong>，<strong>大部分app需要的底层功能</strong>（蓝牙，wifi，相机等）</p>\r\n<h2 id=\"h2-scroll-view-\"><a name=\"scroll-view组件\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>scroll-view组件</h2><p><a href=\"https://mp.weixin.qq.com/debug/wxadoc/dev/component/scroll-view.html\">文档地址</a></p>\r\n<p>遇到的问题是业务上需要下拉加载更多，看文档觉得这个组件正好符合我的需要，提供了一个监听事件<strong> bindscrolltolower </strong></p>\r\n<p><img src=\"/images/1520566550801.png\" alt=\"bindscrolltolower\"><br>估计是我操作不当!或者事件有bug?<br>总之我事件没执行。。。。</p>\r\n<h2 id=\"h2-u6362u79CDu601Du8DEF\"><a name=\"换种思路\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>换种思路</h2><p>看文档发现一个事件<strong>onReachBottom</strong> <a href=\"https://mp.weixin.qq.com/debug/wxadoc/dev/framework/app-service/page.html\">文档地址</a></p>\r\n<p><img src=\"/images/1520567031280.png\" alt=\"onReachBottom\"><br>是一个page事件，可以正常监听到非常赞！！<br>代码如下</p>\r\n<pre><code class=\"lang-javascript\">onReachBottom: function () {\r\n    console.log(&#39;scroll scroll scroll&#39;)\r\n    var that = this;\r\n    wx.request({\r\n      url: host + &#39;contract/contract-list.do&#39;,\r\n      method: &#39;get&#39;,\r\n      header: {\r\n        &#39;content-type&#39;: &#39;application/json&#39; // 默认值\r\n      },\r\n      success: function (res) {\r\n        // console.log(res.data);\r\n        for (var i = 0; i &lt; res.data.data[0].length; i++) {\r\n          console.log(res.data.data[0]);\r\n          res.data.data[0][i].SignDate = formatTime(res.data.data[0][i].SignDate, &#39;Y-M-D h:m:s&#39;);\r\n          res.data.data[0][i].ExpiresDate = formatTime(res.data.data[0][i].ExpiresDate, &#39;Y-M-D h:m:s&#39;);\r\n        }\r\n        //合并数据需要用concat\r\n        var list = that.data.list.concat(res.data.data[0]);\r\n        that.setData({ list: list });\r\n        // setData({ item.SignDate})\r\n      }\r\n    })\r\n    var formatTime = function (number, format) {\r\n      var formateArr = [&#39;Y&#39;, &#39;M&#39;, &#39;D&#39;, &#39;h&#39;, &#39;m&#39;, &#39;s&#39;];\r\n      var returnArr = [];\r\n\r\n      var date = new Date(number);\r\n      returnArr.push(date.getFullYear());\r\n      returnArr.push(formatNumber(date.getMonth() + 1));\r\n      returnArr.push(formatNumber(date.getDate()));\r\n\r\n      returnArr.push(formatNumber(date.getHours()));\r\n      returnArr.push(formatNumber(date.getMinutes()));\r\n      returnArr.push(formatNumber(date.getSeconds()));\r\n\r\n      for (var i in returnArr) {\r\n        format = format.replace(formateArr[i], returnArr[i]);\r\n      }\r\n      return format;\r\n    }\r\n    var formatNumber = function (n) {\r\n      n = n.toString()\r\n      return n[1] ? n : &#39;0&#39; + n\r\n    }\r\n  }\r\n</code></pre>\r\n<h2 id=\"h2-u6CE8u610F\"><a name=\"注意\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>注意</h2><h4 id=\"h4--push-strong-concat-strong-\"><a name=\"我们获取到数据后我本来用的是push合并但是发现不行，查资料发现了<strong>concat</strong>\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>我们获取到数据后我本来用的是push合并但是发现不行，查资料发现了<strong>concat</strong></h4>','最近在开发微信小程序，发现坑不是很多了，\r\n除了ide有点忽悠之外，\r\n优点也是很多，**无需安装**，**可以调用微信接口**，**大部分app需要的底层功能**（蓝牙，wifi，相机等）\r\n\r\n## scroll-view组件\r\n[文档地址](https://mp.weixin.qq.com/debug/wxadoc/dev/component/scroll-view.html)\r\n\r\n遇到的问题是业务上需要下拉加载更多，看文档觉得这个组件正好符合我的需要，提供了一个监听事件** bindscrolltolower **\r\n\r\n![bindscrolltolower](/images/1520566550801.png)\r\n估计是我操作不当!或者事件有bug?\r\n总之我事件没执行。。。。\r\n## 换种思路 \r\n看文档发现一个事件**onReachBottom** [文档地址](https://mp.weixin.qq.com/debug/wxadoc/dev/framework/app-service/page.html)\r\n\r\n![onReachBottom](/images/1520567031280.png)\r\n是一个page事件，可以正常监听到非常赞！！\r\n代码如下\r\n```javascript\r\nonReachBottom: function () {\r\n    console.log(\'scroll scroll scroll\')\r\n    var that = this;\r\n    wx.request({\r\n      url: host + \'contract/contract-list.do\',\r\n      method: \'get\',\r\n      header: {\r\n        \'content-type\': \'application/json\' // 默认值\r\n      },\r\n      success: function (res) {\r\n        // console.log(res.data);\r\n        for (var i = 0; i < res.data.data[0].length; i++) {\r\n          console.log(res.data.data[0]);\r\n          res.data.data[0][i].SignDate = formatTime(res.data.data[0][i].SignDate, \'Y-M-D h:m:s\');\r\n          res.data.data[0][i].ExpiresDate = formatTime(res.data.data[0][i].ExpiresDate, \'Y-M-D h:m:s\');\r\n        }\r\n		//合并数据需要用concat\r\n        var list = that.data.list.concat(res.data.data[0]);\r\n        that.setData({ list: list });\r\n        // setData({ item.SignDate})\r\n      }\r\n    })\r\n    var formatTime = function (number, format) {\r\n      var formateArr = [\'Y\', \'M\', \'D\', \'h\', \'m\', \'s\'];\r\n      var returnArr = [];\r\n\r\n      var date = new Date(number);\r\n      returnArr.push(date.getFullYear());\r\n      returnArr.push(formatNumber(date.getMonth() + 1));\r\n      returnArr.push(formatNumber(date.getDate()));\r\n\r\n      returnArr.push(formatNumber(date.getHours()));\r\n      returnArr.push(formatNumber(date.getMinutes()));\r\n      returnArr.push(formatNumber(date.getSeconds()));\r\n\r\n      for (var i in returnArr) {\r\n        format = format.replace(formateArr[i], returnArr[i]);\r\n      }\r\n      return format;\r\n    }\r\n    var formatNumber = function (n) {\r\n      n = n.toString()\r\n      return n[1] ? n : \'0\' + n\r\n    }\r\n  }\r\n```\r\n\r\n## 注意\r\n\r\n####我们获取到数据后我本来用的是push合并但是发现不行，查资料发现了**concat**\r\n',3,0,'2018-03-09 11:48:53','2018-03-09 11:48:53'),
	(26,'【vue】路由管理','vue的路由方面知识总结.','<h1 id=\"h1-u524Du671Fu51C6u5907\"><a name=\"前期准备\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>前期准备</h1><p><strong>如果你还没有vue的基础知识的情况下请参看下面步骤，如果已经有vue基础和写过demo请跳过。</strong></p>\r\n<h5 id=\"h5-vue-router-\"><a name=\"vue-router官方文档\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span><a href=\"https://router.vuejs.org/zh-cn/\">vue-router官方文档</a></h5><ul>\r\n<li>首先安装vue-cli</li></ul>\r\n<pre><code class=\"lang-shell\">npm install vue-cli\r\n</code></pre>\r\n<p>查看版本号</p>\r\n<pre><code class=\"lang-shell\">lhrdeMacBook-Pro:~ lhr$ vue -V\r\n2.9.3\r\n</code></pre>\r\n<p>出现类似版本号就说明成功了。</p>\r\n<ul>\r\n<li>安装 vue-router</li></ul>\r\n<pre><code class=\"lang-shell\">lhrdeMacBook-Pro:~ lhr$ npm install vue-router -g\r\n+ vue-router@3.0.1\r\nadded 1 package in 1.144s\r\n</code></pre>\r\n<h1 id=\"h1-u521Bu5EFAu9879u76EE\"><a name=\"创建项目\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>创建项目</h1><p>—创建项目</p>\r\n<pre><code class=\"lang-shell\">vue init webpack project-name\r\ncd project-name\r\n</code></pre>\r\n<p>—安装路由</p>\r\n<pre><code class=\"lang-shell\">npm install vue-router\r\n</code></pre>\r\n<h1 id=\"h1-u4FEEu6539u8DEFu7531u89C4u5219\"><a name=\"修改路由规则\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>修改路由规则</h1><p><img src=\"/images/1521075676244.png\" alt=\"路由\"></p>\r\n','\r\n# 前期准备\r\n__如果你还没有vue的基础知识的情况下请参看下面步骤，如果已经有vue基础和写过demo请跳过。__\r\n##### [vue-router官方文档](https://router.vuejs.org/zh-cn/)\r\n- 首先安装vue-cli\r\n\r\n```shell\r\nnpm install vue-cli\r\n```\r\n查看版本号\r\n```shell\r\nlhrdeMacBook-Pro:~ lhr$ vue -V\r\n2.9.3\r\n```\r\n出现类似版本号就说明成功了。\r\n\r\n- 安装 vue-router\r\n\r\n```shell\r\nlhrdeMacBook-Pro:~ lhr$ npm install vue-router -g\r\n+ vue-router@3.0.1\r\nadded 1 package in 1.144s\r\n```\r\n\r\n# 创建项目\r\n\r\n--创建项目\r\n```shell\r\nvue init webpack project-name\r\ncd project-name\r\n```\r\n--安装路由\r\n```shell\r\nnpm install vue-router\r\n```\r\n\r\n# 修改路由规则\r\n\r\n![路由](/images/1521075676244.png)\r\n',3,0,'2018-03-15 09:02:29','2018-03-15 09:02:29'),
	(27,'mac运行任何来源app安装','mac允许任何来源app安装','<pre><code class=\"lang-shell\">lhrdeMacBook-Pro:~ lhr$  sudo spctl --master-disable\r\n</code></pre>\r\n<pre><code class=\"lang-shell\">sudo spctl --master-disable\r\n</code></pre>\r\n','```shell\r\nlhrdeMacBook-Pro:~ lhr$  sudo spctl --master-disable\r\n```\r\n```shell\r\nsudo spctl --master-disable\r\n```',3,0,'2018-03-28 10:26:09','2018-03-29 17:48:03'),
	(28,'spring boot2.0及1.x升级2的注意事项','本文主要介绍spring boot的2.0的一些特征和如何平滑升级的经验。','<h1 id=\"h1--\"><a name=\"一. 服务器要求\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>一. 服务器要求</h1><ol>\r\n<li><p><strong>jdk版本</strong>：首先升级前提是jdk版本，spring boot2.0要求版本必须在jdk8及以上<br><strong>官方文档系统要求:</strong><br>Tomcat 升级至 8.5<br>Flyway 升级至 5<br>Hibernate 升级至 5.2<br>Thymeleaf 升级至 3<br><img src=\"/images/1522766003793.png\" alt=\"系统要求\"></p>\r\n</li><li><p><strong>spring data的一些变化</strong>：对于一些还在观望的小伙伴来说，或许升级最大的麻烦就在于数据库操作了，spring boot升级后同时升级了内置spring data版本，巧了的是spring data版本升级后有很多操作方式发生了一些变化<br>举例说一下我发现的一些变化:<br><strong>查询</strong>:出现了一些新的方法<code>findById</code>，<code>findAllById</code>,貌似还多了一个<code>existsById</code>（不确定之前版本是否就存在），同时findOne()不能传入id进行查询了。<br><strong><em>findById</em></strong>: 反回的是一个<code>Optional&lt;T&gt;</code>对象需要在调用get()获取实体类<br><strong>save</strong>:多了一个saveAll方法<br><strong>delect</strong>: 添加deleteById<br><strong> Hikari</strong>: 使用Hikari 连接池</p>\r\n</li><li><p>一些比较明显的<strong>新特性</strong>：</p>\r\n</li></ol>\r\n<ul>\r\n<li>支持 Spring MVC 的非阻塞式替代方案 WebFlux 以及嵌入式 Netty Server</li><li>基于 Spring 5 构建，Spring 的新特性均可以在 Spring Boot 2.0 中使用</li><li>支持最新的 Java 9</li><li>Redis客户端驱动现在由Jedis变为了Lettuce</li><li>支持HTTP2</li></ul>\r\n<hr>\r\n<h3 id=\"h3--\"><a name=\"欢迎补充！\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>欢迎补充！</h3>','# 一. 服务器要求\r\n1. __jdk版本__：首先升级前提是jdk版本，spring boot2.0要求版本必须在jdk8及以上\r\n__官方文档系统要求:__\r\nTomcat 升级至 8.5\r\nFlyway 升级至 5\r\nHibernate 升级至 5.2\r\nThymeleaf 升级至 3\r\n![系统要求](/images/1522766003793.png)\r\n\r\n2. __spring data的一些变化__：对于一些还在观望的小伙伴来说，或许升级最大的麻烦就在于数据库操作了，spring boot升级后同时升级了内置spring data版本，巧了的是spring data版本升级后有很多操作方式发生了一些变化\r\n举例说一下我发现的一些变化:\r\n__查询__:出现了一些新的方法`findById`，`findAllById`,貌似还多了一个`existsById`（不确定之前版本是否就存在），同时findOne()不能传入id进行查询了。\r\n___findById___: 反回的是一个`Optional<T>`对象需要在调用get()获取实体类\r\n__save__:多了一个saveAll方法\r\n__delect__: 添加deleteById\r\n__ Hikari__: 使用Hikari 连接池\r\n\r\n3. 一些比较明显的__新特性__：\r\n-  支持 Spring MVC 的非阻塞式替代方案 WebFlux 以及嵌入式 Netty Server\r\n-  基于 Spring 5 构建，Spring 的新特性均可以在 Spring Boot 2.0 中使用\r\n-  支持最新的 Java 9\r\n-  Redis客户端驱动现在由Jedis变为了Lettuce\r\n-  支持HTTP2\r\n\r\n---\r\n### 欢迎补充！\r\n\r\n\r\n',3,0,'2018-04-03 22:50:56','2018-04-03 22:51:25'),
	(29,'spring boot读取resources下的资源文件','在spring boot项目中通过java代码读取项目资源文件(resources)下的内容。','<p>可以使用<br>ResourceUtils 工具类</p>\r\n<pre><code class=\"lang-java\">import org.springframework.util.ResourceUtils;\r\n</code></pre>\r\n<p>继而调用</p>\r\n<pre><code class=\"lang-java\">ResourceUtils.getFile(&quot;classpath:static/images/noimage.png&quot;)\r\n</code></pre>\r\n<p>classpath指向根目录，因为我们项目编译后resources下的文件都会被当做资源文件放入classes（即根目录）目录下从而我们可以继续向下寻找我们的文件。</p>\r\n','可以使用\r\nResourceUtils 工具类\r\n```java\r\nimport org.springframework.util.ResourceUtils;\r\n```\r\n继而调用\r\n```java\r\nResourceUtils.getFile(\"classpath:static/images/noimage.png\")\r\n```\r\nclasspath指向根目录，因为我们项目编译后resources下的文件都会被当做资源文件放入classes（即根目录）目录下从而我们可以继续向下寻找我们的文件。\r\n',3,0,'2018-04-11 13:59:46','2018-04-11 13:59:46'),
	(30,'markdown编辑后的内容代码部分处理方法','最近在升级博客，处理了好多小细节，今天跟大家分享一下如何让markdown生成的html代码高亮','<h3 id=\"h3--markdown-html-\"><a name=\"因为我们调用markdown生成的html代码时并不带样式，所以出来的效果很差，代码部分更是很难忍受，所以在此推荐一款代码高亮的插件\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>因为我们调用markdown生成的html代码时并不带样式，所以出来的效果很差，代码部分更是很难忍受，所以在此推荐一款代码高亮的插件</h3><h2 id=\"h2-1-css-js\"><a name=\"1. 引入css和js\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>1. 引入css和js</h2><h4 id=\"h4-google-code-prettify\"><a name=\"google/code-prettify\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span><a href=\"https://github.com/google/code-prettify\">google/code-prettify</a></h4><h3 id=\"h3-u6216u8005\"><a name=\"或者\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>或者</h3><pre><code>&lt;link href=&quot;https://cdn.bootcss.com/prettify/r298/prettify.min.css&quot; rel=&quot;stylesheet&quot;&gt;\r\n&lt;script src=&quot;https://cdn.bootcss.com/prettify/r298/run_prettify.js&quot;&gt;&lt;/script&gt;\r\n</code></pre><p>cdn来自  <a href=\"http://www.bootcdn.cn/\">http://www.bootcdn.cn/</a> 我自己的所有项目都是用的这家的cdn，非常快，免费的。可以尝试一下。</p>\r\n<h2 id=\"h2-2-pre-code-class\"><a name=\"2. 为pre和code标签添加class\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>2. 为pre和code标签添加class</h2><h4 id=\"h4--jquery-\"><a name=\"引入文件后只需要在页面上加入两句jquery代码即可\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>引入文件后只需要在页面上加入两句jquery代码即可</h4><pre><code class=\"lang-javascript\">    // 使用代码高亮\r\n    $(&#39;pre&#39;).addClass(&#39;prettyprint&#39;)\r\n    $(&#39;code&#39;).addClass(&#39;prettyprint&#39;)\r\n</code></pre>\r\n<h4 id=\"h4--markdown-google\"><a name=\"关于markdown请自行google\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>关于markdown请自行google</h4>','### 因为我们调用markdown生成的html代码时并不带样式，所以出来的效果很差，代码部分更是很难忍受，所以在此推荐一款代码高亮的插件\r\n## 1. 引入css和js\r\n#### [google/code-prettify](https://github.com/google/code-prettify)\r\n\r\n### 或者\r\n```\r\n<link href=\"https://cdn.bootcss.com/prettify/r298/prettify.min.css\" rel=\"stylesheet\">\r\n<script src=\"https://cdn.bootcss.com/prettify/r298/run_prettify.js\"></script>\r\n```\r\ncdn来自  http://www.bootcdn.cn/ 我自己的所有项目都是用的这家的cdn，非常快，免费的。可以尝试一下。\r\n\r\n## 2. 为pre和code标签添加class\r\n\r\n#### 引入文件后只需要在页面上加入两句jquery代码即可\r\n```javascript\r\n	// 使用代码高亮\r\n    $(\'pre\').addClass(\'prettyprint\')\r\n    $(\'code\').addClass(\'prettyprint\')\r\n```\r\n\r\n#### 关于markdown请自行google',3,0,'2018-04-11 14:34:33','2018-04-11 15:01:20'),
	(31,'Sequel pro 还原数据库','mac下最好的mysql管理工具Sequel pro，之前一直导数据都是在query里,今天发现可以通过import导入。','<p><img src=\"/images/1523586093566.png\" alt=\"上传的图片\"></p>\r\n<p><img src=\"/images/1523586302707.png\" alt=\"上传的图片\"></p>\r\n','\r\n![上传的图片](/images/1523586093566.png)\r\n\r\n\r\n![上传的图片](/images/1523586302707.png)',3,0,'2018-04-13 10:25:47','2018-04-13 10:25:47');
